// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Import common components
import Navbar from './components/common/Navbar';
import Footer from './components/common/Footer';

// Import your page components (you'll create these)
// For example:
import HomePage from './components/common/HomePage';
import AboutPage from './pages/AboutPage';
import ProjectsPage from './pages/ProjectsPage';
import ContactPage from './pages/ContactPage';
// import ResumePage from './pages/ResumePage';
// import NotFoundPage from './pages/NotFoundPage';
// import ProjectDetail from './components/projects/ProjectDetail'; // Or as a page

function App() {
  return (
    <Router>
      <div className="flex flex-col min-h-screen bg-gray-50"> {/* Full page wrapper */}
        <Navbar />

        {/* Main content area where routed pages will be displayed */}
        <main className="flex-grow container mx-auto px-4 sm:px-6 lg:px-8 py-8">
          <Routes>
            {/* Define your routes here. Example: */}
            <Route path="/" element={<HomePage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/projects" element={<ProjectsPage />} />
            {/* <Route path="/project/:id" element={<ProjectDetail />} /> */}
            <Route path="/contact" element={<ContactPage />} />
            {/* <Route path="/resume" element={<ResumePage />} /> */}
            {/* <Route path="*" element={<NotFoundPage />} /> */}

            {/* Placeholder for pages if they are not created yet */}
            {/* You can remove these once your pages are ready */}
            {/* <Route path="/about" element={<div>About Page Content</div>} /> */}
            {/* <Route path="/projects" element={<div>Projects Page Content</div>} /> */}
            {/* <Route path="/contact" element={<div>Contact Page Content</div>} /> */}
          </Routes>
        </main>

        <Footer />
      </div>
    </Router>
  );
}

export default App;
